import React, { useState } from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";
import Button from "./Button";
import {
  FavoriteBorder,
  MenuRounded,
  SearchRounded,
} from "@mui/icons-material";
import { Avatar } from "@mui/material";
import { useDispatch } from "react-redux";
import LogoImg from "../utils/Images/Logo.svg";
import { logout } from "../redux/reducers/userSlice";

const Nav = styled.div`
  padding: 10px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 1rem;
  position: sticky;
  top: 0;
  z-index: 10;
  color: white;
  background-color: ${({ theme }) => theme.bg};
`;

// ...existing styled components...

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleMenuClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <Nav>
      <NavbarContainer>
        <MobileIcon onClick={handleMenuClick}>
          <MenuRounded style={{color: "inherit"}} />
        </MobileIcon>

        <NavLogo>
          <Logo src={LogoImg} alt="logo" />
        </NavLogo>

        <NavItems>
          <Navlink to="/">Home</Navlink>
          <Navlink to="/properties">Places to stay</Navlink>
          <Navlink to="/contact">Contact</Navlink>
          <Navlink to="/blogs">Blogs</Navlink>
        </NavItems>

        <ButtonContainer>
          <Button type="secondary" text="Sign In" small />
        </ButtonContainer>

        <MobileMenu isOpen={isOpen}>
          <Navlink to="/" onClick={handleMenuClick}>
            Home
          </Navlink>
          <Navlink to="/properties" onClick={handleMenuClick}>
            Places to stay
          </Navlink>
          <Navlink to="/contact" onClick={handleMenuClick}>
            Contact
          </Navlink>
          <Navlink to="/blogs" onClick={handleMenuClick}>
            Blogs
          </Navlink>
          <Button type="secondary" text="Sign In" small />
        </MobileMenu>
      </NavbarContainer>
    </Nav>
  );
};

export default Navbar;
